import React, { Component } from 'react';
import { BrowserRouter as Router, Routes, Route, Redirect } from 'react-router-dom';
import Landing from './routes/Landing';
import TestLink from './routes/exam/TestLink';
import StartTest from './routes/exam/StartTest';
import Result from './routes/exam/Result';
import protectedRoute from './components/protectedRoute';
import { authContextProvider } from './context/authContext';
import Login from './components/Login';

class App extends Component {

    render() {
        return (
            <div>
                <authContextProvider>
                <Routes>
                    <Route exact path="/" element={<Landing />} />
                    <Route path="/testlink" component={
                            <TestLink />
                        } />
                    <Route path="/starttest/:testid" component={
                            <StartTest />
                      } />
                    <Route path="/result/:testid" component={
                            <Result />
                       } />
                </Routes>
                </authContextProvider>
            </div>
        )
    }
}



export default App;
